import React from 'react';
import ReactDOM from 'react-dom/client'; // Importar desde react-dom/client
import './index.css';
import App from './App';
import { ApolloProvider } from '@apollo/client';
import client from './apolloClient'; // Importa tu cliente Apollo

// Crear la raíz de la aplicación
const root = ReactDOM.createRoot(document.getElementById('root'));

// Renderizar la aplicación dentro de la raíz usando ApolloProvider
root.render(
  <ApolloProvider client={client}>
    <App />
  </ApolloProvider>
);
